  false,\n\t\"url\": null,\n\t\"notes\": \"Current meter moorings with internally-recording
  instruments were deployed on this cruise (G01) in July 2012. (The moorings were
  recovered and redeployed in July 2013). During this cruise a CTD/Rosette samplers,
  two shipboard acoustic Doppler currents profilers (75Khz and 300Khz), and an underway
  continuous sampling system were operated. This data set includes CTD data, NISKIN
  bottle samples (salinity, dissolved oxygen, DOC, andestimated oil equivalents) and
  documentation. Nutrients and DIC were collected but not analyzed at the timeof this
  submission.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
